import React from 'react';
import {BrowserRouter} from 'react-router-dom';
import StorePicker from './StorePicker';

const router = () =>(
  <BrowserRouter>
    <Switch>
      <Route exact path="/" component={StorePicker}/>
    </Switch>
  </BrowserRouter>
);
